import React from 'react';
import { Nav, Navbar, } from 'react-bootstrap';
import styled from 'styled-components';

/*const Styles = styled.div`
  .navbar { background-color: #222; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
`;*/

const NavBar=()=>{
  return(
    <Navbar collapseOnSelect bg="dark" expand="md" variant="dark" sticky="top">
      <Navbar.Brand href="#home">Dian CHEN</Navbar.Brand>           
      <Navbar.Toggle aria-controls="responsive-navbar-nav"/>      
      <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
        <Nav className="mr-auto" style={{textAlign:"right"}}>
          <Nav.Item><Nav.Link href="#about">About</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="#project">Project</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="#blog">Blog</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="#contact">Contact</Nav.Link></Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default NavBar
